import React from "react";
import "antd/dist/antd.css";
import { Drawer, Button, Col, Row } from "antd";

function ManageDrawer({}) {
  return (
    <div>
      <Drawer
        title={
          <div>
            Home / <b>Network Statistics</b>
          </div>
        }
        style={{ color: "white" }}
        maskStyle={{
          color: "white",
        }}
        headerStyle={{
          // backgroundColor: "#16151B",
          backgroundColor: "white",
          borderBottomWidth: 0,
        }}
        bodyStyle={{
          backgroundColor: "#16151B",
          color: "white",
        }}
        width={"650px"}
        placement="right"
        closable={true}
        mask={false}
        keyboard={true}
        visible={true}
        onClose={closeNetworkDrawerFunction}
      >
        <div>
          <Row gutter={25}>
            <Col span={12}>
              <TestCard networkDetailObject={networkDetailObject} />
            </Col>
            <Col span={12}>
              <EmergingThreatsCard />
            </Col>
          </Row>
        </div>
        <br />
        <StatisticsBoxes
          networkDeviceCounter={networkDeviceCounter}
          networkStatisticsObject={networkStatisticsObject}
        />
        <br />
        <ThreatsTable />
      </Drawer>
    </div>
  );
}

export default ManageDrawer;
